import react from 'react';

import Navigation from '../components/Navigation/Navigation3';
import Footer from '../components/Footer';
import Slide from '../../components/Slide';

import './Gallery.css';
import img1 from './galimg/1.jpg';
import img2 from './galimg/2.jpg';
import img3 from './galimg/3.jpg';
import img4 from './galimg/4.jpg';
import img5 from './galimg/5.jpg';
import img6 from './galimg/6.jpg';
import img7 from './galimg/7.jpg';
import img8 from './galimg/8.jpg';
import img9 from './galimg/9.jpg';
import img10 from './galimg/10.jpg';
import img11 from './galimg/11.jpg';
import img12 from './galimg/12.jpg';
import img13 from './galimg/13.jpg';
import img14 from './galimg/14.jpg';
import img15 from './galimg/15.jpg';
import img16 from './galimg/16.jpg';
import img17 from './galimg/17.jpg';

const div1 = [img1, img2, img3, img4];
const div2 = [img5, img6, img7, img8, img9];
const div3 = [img10, img11, img12, img13, img14];
const div4 = [img15, img16, img17];

const Gallery = () => {
  return (
    <div class='bg'>
      <Navigation />
      <div class='container'>
        <div class='container g-mg text-center'>
          <h1>제목1</h1>
          <Slide img={div1} />
        </div>
        <hr></hr>
        <div class='container g-mg text-center'>
          <h1>제목1</h1>
          <Slide img={div2} />
        </div>
        <hr></hr>
        <div class='container g-mg text-center'>
          <h1>제목1</h1>
          <Slide img={div3} />
        </div>
        <hr></hr>
        <div class='container g-mg text-center'>
          <h1>제목1</h1>
          <Slide img={div4} />
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default Gallery;
